import { useEffect,useState } from "react"
import { fetchCommodities } from "../api_s/fetchCommodities"
import Item from "./Item"
import {commodities} from '../coins'
function CommoditiesList(){
    const [comms,setComm]=useState(null)
    useEffect(()=>{
        // fetchCommodities().then(data=>setComm(data)).catch(err=>console.error(err))
        setComm(commodities)
    },[])
    useEffect(()=>{
        console.log(comms)
    },[comms])
    return(
        <tbody>
            {comms&& comms.map(comm =><Item item={comm} key={comm.symbol}/>)}
        </tbody>
    )
}
export default CommoditiesList
